window.addEventListener('DOMContentLoaded', () => {
    const uploadForm = document.getElementById('upload-form');
    const uploadedVideo = document.getElementById('uploaded-video');
    const inferenceVideo = document.getElementById('inference-video');
    const spinner = document.getElementById('loader');
    const load_text = document.getElementById('load-text');
    const result_window = document.getElementById('result-window');

    var map = L.map('map').setView([22.606803, 85.338173], 15);
    L.tileLayer('https://{s}.tile.thunderforest.com/outdoors/{z}/{x}/{y}.png?apikey={apikey}', {
        apikey: 'e52530c830af4d8497c64a546ba9c3b0',
        maxZoom: 22
    }).addTo(map);

    const iconDictionary = {
        'Zebra': 'https://png.pngtree.com/png-clipart/20220125/original/pngtree-hand-drawn-wild-animal-zebra-png-image_7205416.png',
        'Deer': 'https://www.freeiconspng.com/uploads/animal-silhouette-silhouette-clip-art-3.png',
        'Elephant': 'https://www.freeiconspng.com/uploads/animal-silhouette--silhouette-clip-art-1.png',
        'Rhino': 'https://www.freeiconspng.com/uploads/animal-silhouette-silhouette-clip-art-4.png',
        'Boar': 'https://www.freeiconspng.com/uploads/farm-animals-silhouettes--silhouettes-of-farm-animals-17.png',
        'Giraffe': 'https://png.pngtree.com/png-clipart/20230819/original/pngtree-high-african-giraffe-monogram-color-on-a-white-background-picture-image_8057789.png',
        'Person': "data:image/png;base64,",
        'Leopard': "data:image/png;base64,",
        'Vehicle': "data:image/png;base64,",
        "Fire": "data:image/png;base64,",
        'Bison': "data:image/png;base64,"
        // Add more mappings here for other classes
    };

    const frameSlider = document.getElementById('frame-slider'); // Slider element

    function displayResults (results, selectedFrame) {
        const tableBody = document.querySelector('#detections-table tbody');
        tableBody.innerHTML = '';

        map.eachLayer(layer => {
            if (layer instanceof L.Marker) {
                map.removeLayer(layer);
            }
        });
        results[selectedFrame].detections.forEach((detection, idx) => {
            const row = tableBody.insertRow();
            row.insertCell().textContent = idx+1;
            row.insertCell().textContent = selectedFrame;
            row.insertCell().textContent = detection.class_name;
            row.insertCell().textContent = detection.confidence.toFixed(2);

            const coordinate = [detection.latitude, detection.longitude];
            markerIcon = L.icon({
                iconUrl: iconDictionary[detection.class_name],
                iconSize: [28, 28],
                iconAnchor: [15.5, 42],
                popupAnchor: [0, -45]
            });

            marker = new L.marker(coordinate, {
                icon: markerIcon
            }).bindPopup(`<b>${detection.class_name}</b><br>conf.: ${detection.confidence.toFixed(2)}`).addTo(map);

            if (detection.class_name === 'Person' || detection.class_name === 'Fire') {
                row.classList.add('table-danger'); // Add Bootstrap class for danger (red background)
            }
        });
    }

    uploadForm.addEventListener('submit', async (event) => {
        event.preventDefault();
        const formData = new FormData(event.target);
        try {
            spinner.style.display = 'inline-block';
            load_text.style.display = 'inline-block';

            const response = await fetch('/upload/', {
                method: 'POST',
                body: formData
            });

            spinner.style.display = 'none';
            load_text.style.display = 'none';

            if (response.ok) {
                const data = await response.json();
                uploadedVideo.src = data.video_data_uri;
                uploadedVideo.play();

                inferenceVideo.src = data.predicted_video_url;
                inferenceVideo.play();

                // Display inference results for the initial frame
                frameSlider.max = data.results.length - 1; // Update the max value of the slider
                frameSlider.value = 0;
                // Set the slider value to the first frame initially
                displayResults(data.results, 0);


                // Add event listener for the frame slider
                frameSlider.addEventListener('input', (event) => {
                    const selectedFrame = parseInt(event.target.value);
                    displayResults(data.results, selectedFrame);
                });
            } else {
                console.error("Upload failed");
            }
        } catch (error) {
            console.error("Network error:", error);
            spinner.style.display = 'none';
            load_text.style.display = 'none';
        }
    });

});
